using System;
using System.Diagnostics;
using Xunit;
using Xunit.Abstractions;

namespace algorithm.Tests
{
    public class SherlockAndValidStringTest
    {
        private readonly ITestOutputHelper output;

        public SherlockAndValidStringTest(ITestOutputHelper output)
        {
            this.output = output;
        }

        [Fact]
        public void Test()
        {
            var sherlockAndValidString = new SherlockAndValidString(output);

            Assert.Equal("NO", sherlockAndValidString.IsValid("aabbcd"));
            Assert.Equal("NO", sherlockAndValidString.IsValid("aabbccddeefghi"));
            Assert.Equal("YES", sherlockAndValidString.IsValid("abcdefghhgfedecba"));
            Assert.Equal("YES", sherlockAndValidString.IsValid("abbac"));
            Assert.Equal("NO", sherlockAndValidString.IsValid("aaaaabc"));
            Assert.Equal("YES", sherlockAndValidString.IsValid(longTest1));
            Assert.Equal("YES", sherlockAndValidString.IsValid(longTest2));
        }

        string longTest1 =
        ""; 
        
        string longTest2 = "";
    }
}